// Function to get bird taxonomy for a given common name
Rcpp::List getTaxonomy(std::unordered_map<std::string, Taxonomy>& taxonomyTable, const std::string& commonName) {
  
  // Check if the common name exists in the hash table
  auto it = taxonomyTable.find(commonName);
  if (it != taxonomyTable.end()) {
    Taxonomy queryInfo = it->second;
    
    // Create a list with taxonomic information
    Rcpp::DataFrame result = 
      Rcpp::DataFrame::create(Rcpp::Named("Order") = queryInfo.order,
                              Rcpp::Named("Family") = queryInfo.family,
                              Rcpp::Named("Sci Name") = queryInfo.sciname);
    return result;
  } else {
    Rcpp::stop("Common name not found in the hash table.");
  }
}

// [[Rcpp::export]]
Rcpp::List getTaxonomyForName(const std::string& commonName) {
  // Create a hash table of bird taxonomy
  std::unordered_map<std::string, Taxonomy> taxonomyTable = createTaxonomyHashTable();
  
  // Get bird taxonomy for the specified common name
  return getTaxonomy(taxonomyTable, commonName);
}